			"description": "Турнир проводится по регламенту.\r\n\r\nВес штанги:\r\nМужчины 50% от собственного веса. \r\nЖенщины 25% от собственного веса. \r\n\r\nПравила выполнения упражнения:\r\n1. Атлет должен лежать на спине, плечами и ягодицами соприкасаясь с поверхностью скамьи, ноги на вису, согнуты в коленях и скрещены между собой.  Подошва его обуви не должна соприкасаться с поверхностью скамьи. Ноги должны быть скрещены между собой. Если в ходе выполнения упражнения спортсмен выпрямил ноги и/или коснулся ногами скамьи, или поставил ноги на пол, либо развел ноги в стороны, то судья обязан дать команду «Ноги» и имеет право не засчитать подход/повторение.\r\n2. Спортсмен только с помощью ассистента снимает штангу со стоек, опускает ее до касания с грудью и начинает выполнять многоповторный жим. Выпрямляя локти до конца.\r\n3. Штанга не должна проваливаться на грудь или совершать движение вниз во время попытки выжать штангу вверх и не должна останавливаться во время выполнения упражнения. Перекос штанги во время движения вверх не должен составлять более 10 см. Запрещено любое касание ступнями ног атлета скамьи, пола или ее опор. В ходе выполнения упражнения на помосте должно быть не менее трех ассистентов, страхующих атлета. Нахождение ассистентов не должно мешать судьям видеть выполнение упражнения.\r\n4. Атлет выполняет жим до тех пор пока контролирует подъем штанги.\r\n5. Отдых разрешается в верхней фазе когда руки строго прямые.\r\n\r\nПобедителем становится участник, который набрал наибольшее количество повторений.\r\n\r\nКоличество призовых мест - 3\r\nКоличество призов - 6",
